import './slider.css'


const Card = ({id,image, descripton, resume}) =>(
    <button id={id}>
        <div>
            <div className='CardImage'><img src={image} alt={resume} /></div>
            <div className='Description'>{descripton}</div>
        </div>
    </button>
)
const CardShower = () =>{
    let CardArray = [
        <Card
        id='Card#0'
        image="chrome://branding/content/about-logo.png"
        resume="tnarunatru"
        />,
        <Card
        image="chrome://branding/content/about-logo.png"
        resume="tnarunatru"
        />,
        <Card
        image="chrome://branding/content/about-logo.png"
        resume="tnarunatru"
        />,
        <Card
        image="chrome://branding/content/about-logo.png"
        resume="tnarunatru"
        />,
        <Card
        image="chrome://branding/content/about-logo.png"
        resume="tnarunatru"
        />,
        <Card
        image="chrome://branding/content/about-logo.png"
        resume="tnarunatru"
        />        
    ] 
    return(
        <div className='SliderCardContainer'>{CardArray}</div>
    )


}

const Slider = () =>(
    <>
        <div className='SliderContainer'>
            <div className='SliderMoveBack'><a href="/#" id='BackLink' onClick="aheadSlide(-1)">&#10094;</a></div>
            <div ClassName='CardContainer'>
                <Card className='Card'
                    image="chrome://branding/content/about-logo.png"
                    resume="tnarunatru"
                />
                <Card className='Card'
                    image="chrome://branding/content/about-logo.png"
                    resume="tnarunatru"
                />    
                <Card className='Card'
                    image="chrome://branding/content/about-logo.png"
                    resume="tnarunatru"
                />    
                <Card className='Card'
                    image="chrome://branding/content/about-logo.png"
                    resume="tnarunatru"
                />    
                <Card className='Card'
                    image="chrome://branding/content/about-logo.png"
                    resume="tnarunatru"
                />    
                <Card className='Card'
                    image="chrome://branding/content/about-logo.png"
                    resume="tnarunatru"
                />    
                <Card className='Card'
                    image="chrome://branding/content/about-logo.png"
                    resume="tnarunatru"
                />    
            </div>
            <div className='SliderMoveAhead'><a href="/#" id='AheadLink' onClick="aheadSlide(1)">&#10095;</a></div>
        </div>    
        <div className='SliderPositions'>
                <span className='position Active' onClick="positionSlide(1)"></span>
                <span className='Position' onClick="positionSlide(2)"></span>
                <span className='Position' onClick="positionSlide(3)"></span>
                <span className='Position' onClick="positionSlide(4)"></span>
                <span className='Position' onClick="positionSlide(5)"></span>
                <span className='Position' onClick="positionSlide(6)"></span>     
        </div>
    </>
)
let indice = 1;
muestraSlides(indice);

function ahedaSlide(n){
    muestraSlides( indice+=n );
}

function posicionSlide(n){
    muestraSlides(indice=n);
}
setInterval(function tiempo(){
    muestraSlides(indice+=1)
},4000);
function muestraSlides(n){
    let i;
    let slides = document.getElementsByClassName('miSlider');
    let barras = document.getElementsByClassName('barra');

    if(n > slides.length){
        indice = 1;
    }
    if(n < 1){
        indice = slides.length;
    }
    for(i = 0; i < slides.length; i++){
        slides[i].style.display = 'none';
    }
    for(i = 0; i < barras.length; i++){
        barras[i].className = barras[i].className.replace(" active", "");
    }

    slides[indice-1].style.display = 'block';
    barras[indice-1].className += ' active';

}
export default Slider
